import React from "react"


export default function LogIn () {
    return(
        <form>
           <label htmlFor="LogInName">
               Username: 
               <input
                    type= "text"
                    name="LogInName"
                    id="LogInName"
                    placeholder="Enter Your UserName"
                    // value={}
                    // onChange={}
                />
           </label>

           <label htmlFor="LogIEmail">
           Email:
               <input
                type="email"
                name="LogIEmail"
                id="email"
                placeholder="Enter Your Email"
                // value={}
                // onChange={}
                />
           </label>

           <label htmlFor="password">
           Password:
               <input
                    type="password"
                    name="password"
                    id="password"
                    placeholder="Enter Your Password"
                    // value={}
                    // onChange={}

                 />
           </label>



           <button>Submit</button>
       </form>
    )
}
